function Login() {
  return (
    <div className="Login flex justify-center items-center h-screen">
      <div className="flex flex-col w-80">
        <input type="text" placeholder="Email" className="border-b p-3 mb-3 rounded-md w-full focus:border-b" />
        <input type="password" placeholder="Password" className="border-b p-3 mb-3 rounded-md w-full" />
        <button type="submit" className="bg-blue-800 text-white p-3 mb-3 w-full rounded-md hover:bg-blue-900">Sign In</button>
        <span className="text-gray-500 text-center">Don't have an account? <a className="text-blue-800 cursor-pointer">Sign up</a></span>
      </div>
    </div>
  );
}

export default Login;
